import React from 'react';
import Nav from '../Nav';
import './home.css';
import image04 from '../../images/04.jpg';
import image05 from '../../images/08.png';
import image09 from '../../images/09.png';
import image10 from '../../images/10.png';
import image11 from '../../images/11.png';

function Home() {
  return (
    <div>
      <div className='nav03'>
        <Nav />
      </div>

      <div className='container03'>
        <img src={image04} alt='image'/>
        <img src={image05} alt='image'/>
      </div>

      <hr className='hr03'></hr>
      <div className='badges03'>
        <div className='09badge'>
        <img src={image09} alt='image09'/>
        <h4>Award wins</h4>
        </div>
        <div className='10badge'>
        <img src={image10} alt='image10'/>
        <h4>International</h4>
        </div>
        <div className='11badge'>
        <img src={image11} alt='image11'/>
        <h4>Best selle</h4>
        </div>
      </div>
    </div>
  );
}

export default Home;
